function RegisterPage() {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [nome, setNome] = useState('');
  const [telefone, setTelefone] = useState('');
  const [role, setRole] = useState('cliente');

  // Campos específicos para cliente
  const [dataNascimento, setDataNascimento] = useState('');
  const [nif, setNif] = useState('');
  const [morada, setMorada] = useState('');

  // Campos específicos para médico
  const [especialidadeId, setEspecialidadeId] = useState('');
  const [crm, setCrm] = useState('');
  const [especialidades, setEspecialidades] = useState([]);

  // Campos específicos para admin
  const [nivelAcesso, setNivelAcesso] = useState('geral');

  const [message, setMessage] = useState('');
  const [successful, setSuccessful] = useState(false);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const navigate = useNavigate();

  useEffect(() => {
    // Carregar especialidades se o usuário selecionar o papel de médico
    if (role === 'medico') {
      const fetchEspecialidades = async () => {
        try {
          const response = await axios.get('http://localhost:8000/api/especialidades');
          setEspecialidades(response.data);
        } catch (error) {
          console.error('Erro ao carregar especialidades:', error);
          setEspecialidades([
            { id: 1, nome: 'Ortodontia' },
            { id: 2, nome: 'Endodontia' },
            { id: 3, nome: 'Periodontia' },
            { id: 4, nome: 'Implantodontia' },
            { id: 5, nome: 'Odontopediatria' }
          ]);
        }
      };

      fetchEspecialidades();
    }
  }, [role]);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    if (password !== confirmPassword) {
      setError('As senhas não coincidem');
      setLoading(false);
      return;
    }

    try {
      // Montagem dos dados específicos por tipo de usuário
      let dadosEspecificos = {};

      if (role === 'cliente') {
        dadosEspecificos = {
          data_nascimento: dataNascimento,
          nif: nif,
          morada: morada
        };
      } else if (role === 'medico') {
        dadosEspecificos = {
          especialidade_id: especialidadeId,
          crm: crm
        };
      } else if (role === 'admin') {
        dadosEspecificos = {
          nivel_acesso: nivelAcesso
        };
      }

      // Envio dos dados para o serviço de autenticação
      const response = await AuthService.register(
        email, 
        password, 
        username, 
        telefone, 
        role, 
        dadosEspecificos
      );

      if (response.data) {
        setSuccessful(true);
        // Redirecionar ou exibir mensagem de sucesso
        setTimeout(() => {
          navigate('/login');
        }, 2000);
      }
    } catch (error) {
      const message = error.response?.data?.message || 'Erro ao registrar-se';
      setError(message);
      console.error("Erro no registro:", error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <PageContainer>
      <Navbar />

      <MainContent>
        <RegisterCard>
          <CardTitle>Criar Conta</CardTitle>

          {error && (
            <AlertMessage className="error">
              {error}
            </AlertMessage>
          )}

          <Form onSubmit={handleSubmit}>
            <RoleSelector>
              <RoleButton
                type="button"
                active={role === 'cliente'}
                onClick={() => setRole('cliente')}
              >
                Cliente
              </RoleButton>
              <RoleButton
                type="button"
                active={role === 'medico'}
                onClick={() => setRole('medico')}
              >
                Médico
              </RoleButton>
              <RoleButton
                type="button"
                active={role === 'admin'}
                onClick={() => setRole('admin')}
              >
                Administrador
              </RoleButton>
            </RoleSelector>

            <FormRow>
              <FormGroup>
                <Label htmlFor="username">Nome de Utilizador</Label>
                <Input
                  type="text"
                  id="username"
                  value={username}
                  onChange={(e) => setUsername(e.target.value)}
                  required
                />
              </FormGroup>

              <FormGroup>
                <Label htmlFor="email">Email</Label>
                <Input
                  type="email"
                  id="email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  required
                />
              </FormGroup>
            </FormRow>

            <FormGroup>
              <Label htmlFor="password">Senha</Label>
              <Input
                type="password"
                id="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
              />
            </FormGroup>

            <FormGroup>
              <Label htmlFor="confirmPassword">Confirmar Senha</Label>
              <Input
                type="password"
                id="confirmPassword"
                value={confirmPassword}
                onChange={(e) => setConfirmPassword(e.target.value)}
                required
              />
            </FormGroup>

            <FormGroup>
              <Label htmlFor="nome">Nome Completo</Label>
              <Input
                type="text"
                id="nome"
                value={nome}
                onChange={(e) => setNome(e.target.value)}
                required
              />
            </FormGroup>

            <FormGroup>
              <Label htmlFor="telefone">Telefone</Label>
              <Input
                type="tel"
                id="telefone"
                value={telefone}
                onChange={(e) => setTelefone(e.target.value)}
                required
              />
            </FormGroup>

            {/* Campos específicos para cliente */}
            {role === 'cliente' && (
              <>
                <FormRow>
                  <FormGroup>
                    <Label htmlFor="dataNascimento">Data de Nascimento</Label>
                    <Input
                      type="date"
                      id="dataNascimento"
                      value={dataNascimento}
                      onChange={(e) => setDataNascimento(e.target.value)}
                      required
                    />
                  </FormGroup>

                  <FormGroup>
                    <Label htmlFor="nif">NIF</Label>
                    <Input
                      type="text"
                      id="nif"
                      value={nif}
                      onChange={(e) => setNif(e.target.value)}
                      required
                    />
                  </FormGroup>
                </FormRow>

                <FormGroup>
                  <Label htmlFor="morada">Morada</Label>
                  <Input
                    type="text"
                    id="morada"
                    value={morada}
                    onChange={(e) => setMorada(e.target.value)}
                    required
                  />
                </FormGroup>
              </>
            )}

            {/* Campos específicos para médico */}
            {role === 'medico' && (
              <>
                <FormGroup>
                  <Label htmlFor="especialidade">Especialidade</Label>
                  <Select
                    id="especialidade"
                    value={especialidadeId}
                    onChange={(e) => setEspecialidadeId(e.target.value)}
                    required
                  >
                    <option value="">Selecione uma especialidade</option>
                    {especialidades.map(esp => (
                      <option key={esp.id} value={esp.id}>
                        {esp.nome}
                      </option>
                    ))}
                  </Select>
                </FormGroup>

                <FormGroup>
                  <Label htmlFor="crm">CRM (Cédula Profissional)</Label>
                  <Input
                    type="text"
                    id="crm"
                    value={crm}
                    onChange={(e) => setCrm(e.target.value)}
                    required
                  />
                </FormGroup>
              </>
            )}

            {/* Campos específicos para admin */}
            {role === 'admin' && (
              <FormGroup>
                <Label htmlFor="nivelAcesso">Nível de Acesso</Label>
                <Select
                  id="nivelAcesso"
                  value={nivelAcesso}
                  onChange={(e) => setNivelAcesso(e.target.value)}
                  required
                >
                  <option value="geral">Geral</option>
                  <option value="total">Total</option>
                  <option value="restrito">Restrito</option>
                </Select>
              </FormGroup>
            )}

            <Button type="submit" disabled={loading}>
              {loading ? 'A processar...' : 'Registar'}
            </Button>

            <LoginLink>
              Já tem uma conta? <Link to="/login">Faça login</Link>
            </LoginLink>
          </Form>
        </RegisterCard>
      </MainContent>

      <Footer />
    </PageContainer>
  );
}

export default RegisterPage;
